import React from 'react';
import Radium from 'radium';

const Todos = props => {
  console.log(props.completed);
  if (props.completed === true) {
    console.log('from todos: true');
  } else {
    console.log('from todos: false');
  }
  return (
    <div>
      <li style={listStyle}>{props.todo}</li>
      <button onClick={props.completed}>Mark Completed</button>
      <button onClick={props.deleteTask}>Delete Task</button>
    </div>
  );
};

const listStyle = {
  listStyleType: 'none',
  border: '2px solid grey',
  backgroundColor: '#fffdd0',
  width: '55%',
  margin: 'auto'
};

export default Todos;
